import './App.css';
import {BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom'
import Home from './pages/Home';
import Garderoba from './pages/Garderoba';
import DodavanjeGarderobe from './pages/DodavanjeGarderobe';

function App() {
  return (
    <div className="App">
    <Router>
      <Link to="/pocetna"> Home </Link>
      <Link to="/garderoba"> Garderoba </Link>
      <Link to="/dodavanje_garderobe"> Dodajte novu vrstu odjece </Link>
      <Routes >
        <Route path='/pocetna' element={<Home/>} />
        <Route path='/garderoba' element={<Garderoba/>} />
        <Route path='/dodavanje_garderobe' element={<DodavanjeGarderobe/>} />
      </Routes >
    </Router>
    </div>
  );
}

export default App;
